import './jogos.css'
import { Celula } from '../../models/bingo/celula';
import Select from 'react-select';

function Jogos() {

  function countLines() {
    let texto = document.getElementById("inputBingo").value;
    var lines = texto.split("\n");
    var count = lines.length;
    console.log(count);

    if (count == 9) {
      const bingo = document.getElementById('bingo')
      bingo.className = "x3"
      const celula = document.createElement(<Celula></Celula>)
      bingo.appendChild(celula);
    };
  }


  return (
    <div className="jogos">
      <div id='bingo'>
      </div>
      <div className='lista'>
        <h1>Jogos de Medo</h1>
        <textarea id='inputBingo' onChange={countLines} />
      </div>
    </div>
  );
}


export default Jogos;
